import React from "react";

export default function Progress() {
  const monthList = [
    { id: 1, name: "January", isComplete: true },
    { id: 2, name: "February" },
    { id: 3, name: "March" },
    { id: 4, name: "April" },
    { id: 5, name: "May" },
    { id: 6, name: "June" },
  ];
  return (
    <div>
      <ul class="w-full sm:w-4/5 text-xs sm:text-sm justify-center lg:justify-end items-center flex flex-row space-x-1 mt-6 overflow-hidden mb-4">
        {monthList?.map((data) => (
          <li key={data?.id}>
            <button
              class={`px-4 py-2 ${
                data?.isComplete ? "bg-green-500" : "bg-gray-200"
              } rounded-full text-sm text-gray-700 hover:bg-indigo-700 hover:text-gray-200`}
            >
              {data?.name}
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
